import React from 'react';
import styled from 'styled-components';
const GridWrapper = styled.div`
  margin-top: 100px;
  margin-bottom: 100px;
  margin-right: 50px;
  margin-left: 80px;

`;
export const Home = (props) => (
    <GridWrapper>
       <form>
            <label>
                Write Something:
                <input type="textarea" name="blog" />
            </label>
            <input type="submit" value="Post" />
        </form>
    </GridWrapper>
  )
